import { useAuth } from "../lib/auth2";

export default function Profile() {
  return <h1>Profile</h1>;
}

export async function getServerSideProps() {
  const { user } = await useAuth();
  console.log(user);
  if (user) {
    return {
      props: user,
    };
  } else {
    <p> error </p>;
  }
}
